import React from 'react';
import './index.css';



const Navbar=() => {
  return (
    <div className='nav'>
        <div className="logo">
            <p>videodrome</p>
        </div>
        <nav className="navigation">
          <ul>
            <li exact to='/about'>About</li>
            <li exact to='/login'>Login</li>
            <li exact to='/signup'>SIGN UP</li>
          </ul>      
        </nav>

    </div>
  )
};


export default Navbar;
